import {BrowserRouter as Router,Route,NavLink,Switch} from "react-router-dom";
import React,{Component} from 'react';
import EmployeePersonalDetails from '../components/EmployeeMasterPersonal';
import EmployeeMasterBank from '../components/EmployeeMasterBank';
import EmployeeMasterIdentification from '../components/EmployeeMasterIdentification';
import EmployeeMasterOffice from '../components/EmployeeMasterOffice';
import parser from 'json-schema-parser';
import '../CSS/EmployeeMaster.css'
export default class EmployeeMasterRoute extends Component{
    render(){
        return(

                            <Router>
                               <div>
                                <div className = 'NavLink' >
                                    <NavLink to = {'/EmployeePersonalDetails'}>Personal</NavLink>
                                    <NavLink to = {'/EmployeeMasterOffice'}>Office</NavLink>
                                    <NavLink to = {'/EmployeeMasterBank'}>Bank</NavLink>
                                    <NavLink to = {'/EmployeeMasterIdentification'}>Identification</NavLink>
                                    <NavLink id = 'Home' to = {'/'}>Home</NavLink>
                                </div>
                                <Switch>
                                <div>
                                    <Route path = '/EmployeePersonalDetails' render = {()=><EmployeePersonalDetails employeeMasterSchema = {parser.parse(this.props.EmployeeSchema).properties.EmployeeMasterPersonal} />}/>
                                    <Route path = '/EmployeeMasterBank' render = {()=><EmployeeMasterBank employeeMasterSchema = {parser.parse(this.props.EmployeeSchema).properties.EmployeeMasterBank} />} />
                                    <Route path = '/EmployeeMasterIdentification' render = {()=> <EmployeeMasterIdentification employeeMasterSchema = {parser.parse(this.props.EmployeeSchema).properties.EmployeeIdentificationDetails} />} />
                                    <Route path = '/EmployeeMasterOffice' render = {()=><EmployeeMasterOffice employeeMasterSchema = {parser.parse(this.props.EmployeeSchema).properties.EmployeeOfficeDetails} />} />
                                </div>
                                </Switch>
                               </div>
                            </Router>

        )
    }
}
